import React from 'react';
import AnimatedPulseIcon from './animated-pulse-icon';
import { CoffeeIcon } from '../icons/icons';

const AnimatedPulseCoffeeIcon = ({ className }) => (
    <AnimatedPulseIcon className={className}>
        <CoffeeIcon />
    </AnimatedPulseIcon>
);

export default AnimatedPulseCoffeeIcon;
